base_urls:
  - http://localhost/ccr2/
  - http://localhost/ccr2s/

normalise:
  regexp:
    - ['/ccr2s/i', 'ccr2']
    - ['#\d{1,2}/[a-z]{3,8}/\d{4} \d{2}:\d{2}:\d{2}#i', "DATETIME"]
    - ['#legacy/#', '']
    - ["#			<li>\n<a href='http://localhost/ccr2/printingdatasheets'>Printing tch groups</a></li>\n#m", '']
    - ["#			<li>\n<a href='http://localhost/ccr2/subjectAnalysis'>Subject analysis</a></li>\n#m", '']
    - ["#d=\d{5,12}\"></script>#", 'd="></script>']
    - ["#		<option value=\"\*[A-Z]{2}\" >\*[A-Z]{2}</option>\n#", '']
    - ["#<option value=\"\w{2,4}-\*[a-z]{2}\" >\*[a-z]{2}</option>#i", '']
    - ["#<br>#i", '<br/>']
    - ["#ccr2//#i", 'ccr2/']
    - ["#<title>Explain - #i", '<title>']
    - ["#progressAnalysisBySublevel#i", 'progressAnalysisFromKS4Start']

